function Menu() {
    return (
        <nav className = "Menu">
           <a href ="/">
            <img className ="Logo" src = {Logo} alt ="Spotiflix logo" />
           </a> 
            <a className = "ButtonLink" href ="/">
              Nuevo video
            </a>
        
        
        </nav>

    );

}



export default Menu;
